class CountryCodeModel {
  final String country;
  final String code;

  const CountryCodeModel({required this.country, required this.code});

  factory CountryCodeModel.fromJson(Map<String, dynamic> json) {
    return CountryCodeModel(country: json['country'], code: ['calling_code']);
  }
}
